textOriginal:
A trajetória da maior quadrilha que o Brasil teve PT com Lula e Dilma, até a maior recessão econômica do Brasil, que levou uma crise tremenda. Para refrescar a memória do fã clube do ladrão. Volta Lula tô com saudade dos escândalos kkkkk

